function App() {

  return (
    <div className='App'>
      <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/admin" element={<AdminPage />} />
          <Route path="/user1" element={<UserPage1 />} />
          <Route path="/user2" element={<UserPage2 />} />
        </Routes>
      </Router>
    </div>

  );
};


